<style lang="postcss">
#groom-and-bride {
  fill: black;
  stroke: #000; 
  stroke-width: 0.8;
  stroke-dasharray: 1000; /* Length of the path */
  stroke-dashoffset: 1000; /* Hide the path initially */
  stroke-opacity: 100%;
  animation: writePath 4s forwards linear; /* Adjust duration as needed */
  opacity: 10%;
}

@keyframes writePath {
  to {
    stroke-dashoffset: 0; /* Reveal the path completely */
    opacity: 80%;
    stroke-width: 2;
  }
}

#buttons {
  animation: reveal 1s linear forwards;
}

@keyframes reveal {
  to {
    opacity: 1;
  }
  from {
    opacity: 0;
  }
}

.wedding-card {
  background-image: url('$lib/images/background.png');
  background-repeat: no-repeat;
  background-size: cover;
  max-height: 90vh;
  max-width: 90vw;
} 

#calendar-button:active,
#rsvp-button:active,
#location-button:active {
  transform: translateY(4px);
}

.shadow {
  filter: drop-shadow(3px 5px 2px rgb(0 0 0 / 0.4));
}
</style>